import service from '@/utils/request'

/**
 * 处理用户登录
 */
export const handleLogin = (data) => {
  return service({
    method: 'post',
    url: '/api/user/doLogin',
    data
  })
}

/**
 * 处理用户登出
 */
export const handleLogout = (data) => {
  return service({
    method: 'get',
    url: '/api/user/logout'
  })
}
